import { Menu } from 'react';
// import '../../assets/style/header.css';

class Header extends Component{
    constructor(props) {
        super(props);

    }
    render(){
        return(
            <div className="header-div">
                <div className="nav-div">
                    <Menu onClick={this.handleClick} selectedKeys={[current]} mode="horizontal">
                        <Menu.Item key="mail">
                            Navigation One
                        </Menu.Item>
                        <Menu.Item key="app">
                            Navigation Two
                        </Menu.Item>
                    </Menu>
                    <ul className="nav-ul">
                        <li>
                            <img src="/src/assets/images/logo.png" alt="首页图标"/>
                        </li>
                        <li>推荐</li>
                        <li>排行榜</li>
                        <li>歌单</li>
                        <li>主播电台</li>
                        <li>歌手</li>
                        <li>新碟上架</li>
                        <li>登录</li>
                    </ul>
                </div>
            </div>
        )
    }
}

export default Header;
